import {useState,useEffect} from 'react'
import  './style.css'
function MyNewP(){

 const [time, setTime] = useState(0);

    function add(){
      //  Date.now()
      const res = Date.now();
      setTime(res);
    }

    return(
        <div>

<button className='Spotify' onClick={add} >click</button>
        <ShowTime test={time} setTest={setTime} ok="hello" />

        </div>
    )
}


function ShowTime({test,ok,setTest}){
    

    return <h2 onClick={()=>{ setTest("clicked") }}>it is {test} {ok}</h2>
}
export default MyNewP;
